import React, { Component } from 'react'
import profile from '../images/pernalonga.jpeg'

export default class About extends Component {
  render() {
    return (
      <div>
        <h2>Sobre mim</h2>

        <div>
          <img src={profile} alt="img-profile"/>
        </div>

      </div>
    )
  }
}
